import React, { Component } from "react";
import TextField from '@mui/material/TextField';
import './Signup.css';


class Signup extends React.Component{
	render(){
		return(
			<div className="signup">
				<h1>Sign Up</h1>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Last Name" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="First Name" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="E-mail" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Phone Number" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Picture" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Password" variant="outlined" /></div>
				<div className="textfield"><TextField fullWidth id="outlined-basic" label="Confirm Password" variant="outlined" /></div>
			</div>
		)
	}
}

export default Signup;
